def main(s: str, k: int) -> int:
    ans = vowel = 0
    for i, c in enumerate(s):
        if c in "aeiou":
            vowel += 1
        left = i - k + 1  # 左端点

        if left < 0:  # 窗口大小不足k, 不能形成第一个窗口
            continue

        ans = max(ans, vowel)
        if ans == k:
            break

        if s[left] in "aeiou":
            vowel -= 1

    return ans


if __name__ == '__main__':
    print(main("abciiidef", 3))
    print(main("aeiou", 2))
    print(main("leetcode", 3))
    print(main("rhythms", 4))
    print(main("tryhard", 4))
    print(main(
        "",
        50436))
